import "core-js/modules/es6.array.iterator";
import "core-js/modules/es6.promise";
import Vue from 'vue';
import Router from 'vue-router';
import HelloContainer from "./components/HelloWorld.vue"; //1.引入自定义组件

import testContainer from "./components/testContainer.vue";
import listContainer from "./components/listContainer.vue";
import HomeContainer from "./components/tabbar/HomeContainer.vue";
import newsListContainer from "./components/news/newsListContainer";
import newInfoContainer from "./components/news/newInfoContainer";
import shopContainer from "./components/tabbar/shopContainer";
Vue.use(Router); //2.配置访问自定义组件路径

export default new Router({
  routes: [{
    path: '/',
    component: HelloContainer
  }, {
    path: '/test',
    component: testContainer
  }, {
    path: '/list',
    component: listContainer
  }, {
    path: '/home',
    component: HomeContainer
  }, {
    path: '/home/newslist',
    component: newsListContainer
  }, {
    path: '/',
    redirect: '/home'
  }, {
    path: '/home/newsinfo',
    component: newInfoContainer
  }, {
    path: '/home/shop/:id ',
    component: shopContainer
  }]
});
